import { Container } from "@mui/material";
import React from "react";

import { Routes, Route } from "react-router-dom";
import pages from "../Pages/index";
import "../../index.css";
function App() {
  return (
    <div className="App">
      {/* <nav>
        <Link></Link>
      </nav> */}
      <Routes>
        <Route path="/" exact element={pages.intro()} />
        <Route path="/contact" exact element={pages.contact()} />
        <Route path="/financial_info" exact element={pages.financial()} />
        <Route path="/financial_info" exact element={pages.business()} />
        <Route path="/financial_info" exact element={pages.policies()} />
        <Route path="/financial_info" exact element={pages.industry()} />
        <Route path="*" element={pages.intro()} />
      </Routes>
    </div>
  );
}

export default App;
